import React,{ Component } from 'react';
import Header_nav from './nav/Header_nav';
import Middle_nav from './nav/Middle_nav';
import Categories from './categories/Categories';
import Carousel_product from './carousel-product/Carousel_product';
import Book_SGK from './products/sgk_l/Book_SGK';
import Book_SKH from './products/skh_r/Book_SKH';
import Banner_sale from './banner/Banner_sale';
import Footer from './footer/Footer';
import Banner_header from './banner/Banner_header';
import Banner_footer from './banner/Banner_footer';
import ScrollButton from './Scroll_To_Top';
class App extends Component {
  render(){
  return (
    <div className="App">
      <div>
      <ScrollButton />
      <Header_nav />
      <Middle_nav />
      <Categories />
      <Carousel_product />
      <hr></hr>
      <Banner_header />
      <hr></hr>
      <Book_SGK />
      <hr></hr>
      <Banner_sale />
      <hr></hr>
      <Book_SKH />
      <hr></hr>
      <Banner_footer />
      <Footer />
      </div>
    </div>
  );
}
}

export default App;
